import React from 'react';

const CategoryItem = (props) => {
    return(
        <figure class="col-12 col-sm-12 col-md-6 col-lg-4 port-container">
          <img 
          src={props.image} 
          alt={props.title} 
          style={props.custom ? props.custom : null } />
          <figcaption>
            <i>{props.title}</i><br />{props.caption}
          </figcaption>
        </figure>
    )
}

export default CategoryItem;
